<script setup>
import { nextTick, onMounted, onUnmounted, ref } from 'vue'

const wheelScaleFactor = ref(1)
const wheelBaseWidth = 489 // Value needs to be changed if the wheel ever changes
// Corresponds to the wheel size after the individual svg parts are positioned and the wheel is looking good
// This value is essential for proper scaling

function onResize() {
  let currentWidth = document.querySelector('.team__wheel').offsetWidth
  wheelScaleFactor.value = currentWidth / wheelBaseWidth
}

onMounted(async () => {
  await nextTick()
  onResize()
})

onMounted(() => {
  window.addEventListener('resize', onResize)
})

onUnmounted(() => {
  window.removeEventListener('resize', onResize)
})
</script>

